function App() {
  return (
    <div class="container">
      <div style={{padding:"10px"}}>
        {
          EmailBlock()
        }
        </div>
        <div>      
          {
            PassWordBlock()
          }
        </div>
        <div>
          {
            SigninButton()
          }
        </div>
      </div>
  );
} 

export default App;
